settings.nodeIconFunction:
/** 

// Function should return node icon info object.
// Resulting object should contain either 'materialIcon' or 'iconUrl' property. 
// Where:
    - 'materialIcon' - name of the material icon to be used from the Material Icons Library (https://material.io/tools/icons);
    - 'iconUrl' - url of the external image to be used as node icon.
// Function can return 'default' string value. In this case default icons according to entity type will be used.

// The following example code shows how to use external image for devices which name starts with 'Test' and use 
// default icons for the rest of entities.

var entity = nodeCtx.entity;
if (entity.id.entityType === 'DEVICE' && entity.name.startsWith('Test')) {
    return {iconUrl: 'https://avatars1.githubusercontent.com/u/14793288?v=4&s=117'};
} else {
    return 'default';
}

**/

settings.nodeTextFunction:
/**

// Function should return text (can be HTML code) for the current node.

// The following example code will generate node text consisting of entity name and temperature if temperature value is present in entity attributes/timeseries.

var data =  nodeCtx.data;
var entity = nodeCtx.entity;
var text = entity.name;
if (data.hasOwnProperty('temperature') && data['temperature'] !== null) {
    text += " <b>"+ data['temperature'] +" °C</b>";
}
return text;

**/

settings.nodesSortFunction:
/**

// This function is used to sort nodes of the same level. Function should compare two nodes and return 
// integer value: 
//     - less than 0 - sort nodeCtx1 to an index lower than nodeCtx2
//     - 0 - leave nodeCtx1 and nodeCtx2 unchanged with respect to each other
//     - greater than 0 - sort nodeCtx2 to an index lower than nodeCtx1

// The following example code will sort entities first by entity type in alphabetical order then
// by entity name in alphabetical order.

var result = nodeCtx1.entity.id.entityType.localeCompare(nodeCtx2.entity.id.entityType);
if (result === 0) {
    result = nodeCtx1.entity.name.localeCompare(nodeCtx2.entity.name);
}
return result;

**/

headerButton.customFunction:
let $injector = widgetContext.$scope.$injector;
let customDialog = $injector.get(widgetContext.servicesMap.get('customDialog'));
let assetService = $injector.get(widgetContext.servicesMap.get('assetService'));
let attributeService = $injector.get(widgetContext.servicesMap.get('attributeService'));

openAddAssetDialog();

function openAddAssetDialog() {
    customDialog.customDialog(htmlTemplate, AddAssetDialogController).subscribe();
}

function AddAssetDialogController(instance) {
    let vm = instance;

    vm.addAssetFormGroup = vm.fb.group({
      assetName: ['', [vm.validators.required]],
      assetType: ['', [vm.validators.required]],
      assetLabel: [''],
      attributes: vm.fb.group({
          latitude: [null],
          longitude: [null]
      })      
    });

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };

    vm.save = function() {
        vm.addAssetFormGroup.markAsPristine();
        let asset = {
            name: vm.addAssetFormGroup.get('assetName').value,
            type: vm.addAssetFormGroup.get('assetType').value,
            label: vm.addAssetFormGroup.get('assetLabel').value
        };
        assetService.saveAsset(asset).subscribe(
            function (asset) {
                saveAttributes(asset.id).subscribe(
                    function () {
                        widgetContext.updateAliases();
                        vm.dialogRef.close(null);
                    }
                );
            }
        );
    };

    function saveAttributes(entityId) {
        let attributes = vm.addAssetFormGroup.get('attributes').value;
        let attributesArray = [];
        for (let key in attributes) {
            attributesArray.push({key: key, value: attributes[key]});
        }
        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(entityId, "SERVER_SCOPE", attributesArray);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }
}

actionCellButton.customFunction:
let $injector = widgetContext.$scope.$injector;
let customDialog = $injector.get(widgetContext.servicesMap.get('customDialog'));
let assetService = $injector.get(widgetContext.servicesMap.get('assetService'));
let attributeService = $injector.get(widgetContext.servicesMap.get('attributeService'));

openEditAssetDialog();

function openEditAssetDialog() {
    customDialog.customDialog(htmlTemplate, EditAssetDialogController).subscribe();
}

function EditAssetDialogController(instance) {
    let vm = instance;

    vm.asset = null;
    vm.attributes = {};

    vm.editAssetFormGroup = vm.fb.group({
      assetName: ['', [vm.validators.required]],
      assetType: ['', [vm.validators.required]],
      assetLabel: [''],
      attributes: vm.fb.group({
          latitude: [null],
          longitude: [null]
      })      
    });

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };

    vm.save = function() {
        vm.editAssetFormGroup.markAsPristine();
        vm.asset.name = vm.editAssetFormGroup.get('assetName').value,
        vm.asset.type = vm.editAssetFormGroup.get('assetType').value,
        vm.asset.label = vm.editAssetFormGroup.get('assetLabel').value
        assetService.saveAsset(vm.asset).subscribe(
            function () {
                saveAttributes().subscribe(
                    function () {
                        widgetContext.updateAliases();
                        vm.dialogRef.close(null);
                    }
                );
            }
        );
    };

    getEntityInfo();

    function getEntityInfo() {
        assetService.getAsset(entityId.id).subscribe(
            function (asset) {
                attributeService.getEntityAttributes(entityId, 'SERVER_SCOPE',
                                                    ['latitude', 'longitude']).subscribe(
                   function (attributes) {
                        for (let i = 0; i < attributes.length; i++) {
                            vm.attributes[attributes[i].key] = attributes[i].value; 
                        }
                        vm.asset = asset;
                        vm.editAssetFormGroup.patchValue(
                            {
                                assetName: vm.asset.name,
                                assetType: vm.asset.type,
                                assetLabel: vm.asset.label,
                                attributes: {
                                    latitude: vm.attributes.latitude,
                                    longitude: vm.attributes.longitude
                                }
                            }, {emitEvent: false}
                        );
                   } 
                );
            }
        );    
    }

    function saveAttributes() {
        let attributes = vm.editAssetFormGroup.get('attributes').value;
        let attributesArray = [];
        for (let key in attributes) {
            attributesArray.push({key: key, value: attributes[key]});
        }
        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(entityId, 'SERVER_SCOPE', attributesArray);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }
}

let $injector = widgetContext.$scope.$injector;
let dialogs = $injector.get(widgetContext.servicesMap.get('dialogs'));
let assetService = $injector.get(widgetContext.servicesMap.get('assetService'));

openDeleteAssetDialog();

function openDeleteAssetDialog() {
    let title = "Are you sure you want to delete the asset " + entityName +  "?";
    let content = "Be careful, after the confirmation, the asset and all related data will become unrecoverable!";
    dialogs.confirm(title, content, 'Cancel', 'Delete').subscribe(
        function (result) {
            if (result) {
                deleteAsset();
            }
        }
    );
}

function deleteAsset() {
    assetService.deleteAsset(entityId.id).subscribe(
        function () {
            widgetContext.updateAliases();
        }
    );
}

